import React, { Component } from 'react';


class GridSystem extends Component {
    render(){
         return () => {
       
            function onDragStart(event) {
                event
                  .dataTransfer
                  .setData('text/plain', event.target.id);
              
                event
                  .currentTarget
                  .style
                  .backgroundColor = 'yellow';
              }
       
        }
    }

}

export default GridSystem;
